    <path stroke-dasharray="12, 4.5" stroke-width="1.5" stroke="#424242" fill="none" d="M33.8 100.44L82.15 100.44" />
    <g transform="matrix(1, 0, 0, 1, 31.742126, 36.52953)"><text font-family="Oswald" font-style="normal" font-weight="normal" font-stretch="normal" font-size="22.5pt" fill="#424242" x="0" y="36.338028"><tspan x="0" y="36.338028">О себе</tspan></text></g>
    <g transform="matrix(1, 0, 0, 1, 31.742126, 122.85434)"><text font-family="Source Code Pro" font-style="normal" font-weight="normal" font-stretch="normal" font-size="13.5pt" fill="#424242" x="0" y="134.80515"><tspan x="0" y="19.445154">Я люблю создавать крутые продукты, которые делают жизнь людей</tspan><tspan xml:space="preserve" x="655.75" y="19.445154"> </tspan><tspan x="0" y="44.285156">лучше. У меня больше 10 лет опыта в сфере веб-дизайна: от</tspan><tspan xml:space="preserve" x="612.75" y="44.285156"> </tspan><tspan x="0" y="69.12515">небольших стартапов до всемирно известных гигантов.</tspan><tspan x="0" y="109.96515">Я вырос в [Город], увлекаюсь сплавами по рекам и</tspan><tspan xml:space="preserve" x="516" y="109.96515"> </tspan><tspan x="0" y="134.80515">робототехникой. Ищу интересные предложения!</tspan></text></g>
  </g>
